def strlen(string: str) -> int:
    """ Return length of given string
    >>> strlen('')
    0
    >>> strlen('abc')
    3
    """
    if string.isalnum():
        return len(string)
    elif string.isdigit():
        return len(string)
    elif string.isalpha():
        return len(string)
    elif string.islower():
        return len(string)
    elif string.startswith('abc'):
        return len(string[1:])
    else:
        raise ValueError("string must be a string")

